webpackJsonp([3,113],{1182:function(I,i,j){I.exports={content:"<style>.transformer-react-render{border:1px dashed #959da5;border-radius:5px;display:block}.transformer-react-render-container>pre{max-height:400px;transition:all .2s ease}.transformer-react-render-container>pre.focused{max-height:none;box-shadow:0 0 6px rgba(0,0,0,.2)}</style><p>使用 Mac 的同学需要先安装 <a href=https://brew.sh/>brew</a>， 然后使用 brew 安装 <a href=https://github.com/asciinema/asciinema>asciinema</a> 即可</p><pre><code data-query={} data-lang>brew install asciinema\n\n# 开始录制屏幕，数据放在 local.json 中\nasciinema rec local.json\n</code></pre><p>执行 <code>asciinema rec</code> 后，便可以在当前会话中演示你的命令行交互了，最后 Ctrl + D 结束录制即可，local.json 文件就保存了我们的命令行交互记录。</p><p>然后还需要安装 <a href=https://www.npmjs.com/package/svg-term-cli>svg-term-cli</a>，用于转换 <code>local.json</code> 到 svg</p><pre><code data-query={} data-lang>npm install -g svg-term-cli\n\ncat local.json | svg-term --height=40 --out=svg.svg --window\n</code></pre><p>最终录制的效果如下图，瞬间高大上：</p><p><img src=./how-to-record-command-line.svg data-image-loader=0></p>",extra:{"_image-loader_":[j(1263)],_progressive_:[]}}},1263:function(I,i){I.exports="data:image/svg+xml;base64,"}});
